import React from "react";
import Table from "react-bootstrap/Table";

const GradeCriteria = () => {
	const grades = [
		{
			percentage: "80-100",
			gpa: "4.00",
			grade: "A",
			remarks: "Excellent",
		},
		{
			percentage: "76-79",
			gpa: "3.80",
			grade: "A-",
			remarks: "Very Good",
		},
		{
			percentage: "72-75",
			gpa: "3.50",
			grade: "B+",
			remarks: "Good",
		},
		{
			percentage: "68-71",
			gpa: "3.00",
			grade: "B",
			remarks: "Better",
		},
		{
			percentage: "64-67",
			gpa: "2.80",
			grade: "B-",
			remarks: "Best",
		},
		{
			percentage: "60-63",
			gpa: "2.50",
			grade: "C+",
			remarks: "Not Good",
		},
		{
			percentage: "55-59",
			gpa: "2.00",
			grade: "C",
			remarks: "Satisfactory",
		},
		{
			percentage: "50-54",
			gpa: "1.00",
			grade: "D",
			remarks: "Not Satisfactory",
		},
		{
			percentage: "0-49",
			gpa: "0.00",
			grade: "F",
			remarks: "Poor",
		},
	];
	return (
		<Table responsive hover bordered striped className="my-4">
			<thead>
				<tr>
					<th className="bg-dark text-white">Percentage</th>
					<th className="bg-dark text-white">GPA</th>
					<th className="bg-dark text-white">Grade</th>
					<th className="bg-dark text-white">Remarks</th>
				</tr>
			</thead>
			<tbody>
				{grades.map((grade) => (
					<tr key={grade.percentage}>
						<td>{grade.percentage}</td>
						<td>{grade.gpa}</td>
						<td>{grade.grade}</td>
						<td>{grade.remarks}</td>
					</tr>
				))}
			</tbody>
		</Table>
	);
};

export default GradeCriteria;
